import React from 'react';

const Headings = () => {
  return (
    <div>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Font Family:</h5>
        </div>
      </div>
    </div>
  );
};

export default Headings;
